from Crypto.Util.number import long_to_bytes
from math import gcd

def find_facteur(n,e,v,c):
    facteur = gcd(n, pow(c,e,n)-v)
    return facteur 

def déchiffre(n,d,ct):
    res = pow(ct,d,n)
    return res

